    [],nt"revision_timestamp": "2016-06-08T03:11:04.665501",nt"name": "2010-003-fa-hypack-metaholder-raw-hypack-navigation-logs-text-collected-by-the-u-s-geolog-2010",nt"isopen":
    false,nt"url": null,nt"notes": "These data were collected under a cooperative
    agreement between the Massachusetts Office of Coastal Zone Management (CZM) and
    the U.S. Geological Survey (USGS), Coastal and Marine Geology Program, Woods Hole
    Coastal and Marine Science Center (WHCMSC). Initiated in 2003, the primary objective
    of this program is to develop regional geologic framework information for the management
    of coastal and marine resources. Accurate data and maps of seafloor geology are
    important first steps toward protecting fish habitat, delineating marine resources,
    and assessing environmental changes due to natural or human impacts. The project
    is focused on the inshore waters of coastal Massachusetts, primarily in water depths
    of 2-30 meters. Data collected for the mapping cooperative have been released in
    a series of USGS Open-File Reports (<http://woodshole.er.usgs.gov/project-pages/coastal_mass/>).
    The data collected in this study area located around the western extent of the Elizabeth
    Islands includes high resolution bathymetry, acoustic-backscatter intensity, seismic-reflection,
    and navigation data. These data were collected during a nearshore cruise in September
    2010 onboard the R/V Rafael using the following equipment: an SEA Ltd SwathPlus
    interferometric sonar (234 kHz), Klein 3000 dual frequency sidescan sonar, an Edgetech
    424 chirp subbottom profiling system, and 4 GPS antennae. More information about
    the cruise conducted as part of the project: Geologic Mapping of the Seafloor Offshore
    of Massachusetts can be found on the Woods Hole Coastal and Marine Science Center
    Field Activity webpage: <http://quashnet.er.usgs.gov/data/2010/10003/>",nt"license_title":
